import React, {useState, useEffect } from 'react';

import { getArray } from '../../api/api';

const Dashboard = () => {

    interface IDashboard {
        chiropractorId: number;
        firstName: string;
        lastname: string;
        emailAddress: string;
        phoneNumber: number;
        timeCreated: Date;
    }

    const [chiropractorDetails, setchiropractorDetails] = useState<any[]>([]);

    useEffect(() => {
        const makeArrayRequest = async () => {
            setchiropractorDetails(await getArray());
        }
        makeArrayRequest();
        
        }, [])

    console.log(chiropractorDetails);

    return (
        <>
            {chiropractorDetails}
        </>    
    )
}

export default Dashboard;
